**Problem Statement** 
Graph optimization is a set of techniques, for example ConstantFolding and DeadCodeRemoval, which are used to reduce the complexity of the ML model graph to improve performance at runtime. Currently, there are ONNX graph optimization and ONNX Runtime graph optimization.  
ONNX graph optimization is performed during the generation of the ONNX model and the ONNX Runtime graph optimization is performed during model inference.  

It is desirable to serialize an optimized model in order to reduce the session load time. Loading an optimized model with graph transformation level as zero will also reduce model load times as the model will not be transformed during initialization as part of the service. 
**Changes** 
The InferenceSession.Initialize() function performs graph transformations. The proposed change is to serialize the optimized model after graph transformations and the graph.resolve function call in InferenceSession.Initialize(). The graph resolve call updates the model graph nodes and initializes inputs, outputs and edges. 
    if (!session_options_.optimized_model_filepath.empty()) { 
      // Serialize optimized onnx model. 
      Model::Save(*model_, session_options_.optimized_model_filepath); 
    } 
The optimized_model_filepath option in session options is used in onnxruntime_c_api.h to specify if the optimized model needs to be serialized. This session options is set from the onnxruntime_c_api.h with the following api function. 
ORT_API_STATUS(OrtSetOptimizedModelFilePath, _In_ OrtSessionOptions* in, _In_ const ORTCHAR_T* optimized_model_filepath); 
**Validation** 
The changes are validated by serializing the optimized model with graph transform level 1, as model_transform_1.onnx. The optimized model, model_transform_1.onnx, is loaded again in inference session with graph transform level 0 and serialized as model_transform_0.onnx. We validate that the outcome of two operations are same to validate that a pre-optimized model will not change when loaded in Onnx runtime.

