**Describe the bug**
(performance) ONNX runtime applies an optimization that transforms the graph MatMul + Add -> GEMM for floating point tensors. However, an overly strict type check prevents that same fusion optimization from being applied to float16 tensors, which deprives a noticeable perf improvement in models.

The issue appears to be in [matmul_add_fusion.cc](https://github.com/microsoft/onnxruntime/blob/master/onnxruntime/core/optimizer/matmul_add_fusion.cc), expecting tensors to be only float32:

    if ((*matmul_type) != "tensor(float)" || (*add_type) != "tensor(float)") {
      continue;
    }

When I locally make the change (checking that MatMul and Add use the same tensor type, and that they are either float32 or float16), the fusion occurs with correct output (reaching the GEMM GPU kernel).

